import "./App.css";
import "./index.css";
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";

function App() {
  return (
    <>
    <Router>
      <h1>I am Rehman</h1>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </Router>
    </>
  );
}

export default App;

const HomePage = () => <div>Home Page</div>;
